import React, { useEffect, useState } from "react";
import axios from "axios";

const Test = () => {
  const [response, setResponse] = useState("");
  useEffect(() => {
    axios
      .get("api/hello")
      .then((response) => {
        console.log(response);
        setResponse(response);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  const dataList = response.data;
  return <div>{dataList}</div>;
};

export default Test;
